import { PredicateParam, PredicateParamFunc } from './common/baseCompare';
/**
 * 移除数组中predicate（断言）返回为真值的所有元素，并返回移除元素组成的数组(使用pull方法来根据提供的value值从数组中移除元)。
 * predicate（断言） 会传入3个参数： (value, index, array)。
 * 返回移除元素组成的新数组
 * @param input
 * @param predicate
 */
export default function remove(input: any[], predicate?: PredicateParam | PredicateParamFunc): any[];
